import React from 'react';
import './ObjectsPriceContent.css'; // Импортирай новия CSS файл

const ObjectsPriceContent = ({ formData, handleInputChange, success, apartments, garages, parkingPlaces }) => {
    return (
        <div className="objects-container">
            <h2>Add Objects</h2>
            
            <div className="icons-container">
                <div className="icon">
                    <img src="building-icon.png" alt="Building" /> {/* Може да добавиш свои икони */}
                    <span>Building</span>
                </div>
                <div className="icon">
                    <img src="garage-icon.png" alt="Garage" />
                    <span>Garage</span>
                </div>
                <div className="icon">
                    <img src="parking-icon.png" alt="Parking" />
                    <span>Parking</span>
                </div>
            </div>

            <div className="added-objects-container">
                <div className="added-objects-list">
                    {/* Тук можеш да добавиш логиката за показване на добавените обекти */}
                    <div>Object 1</div>
                    <div>Object 2</div>
                    <div>Object 3</div>
                    {/* Тези обекти ще бъдат показани с хоризонтален скрол */}
                </div>
            </div>
        </div>
    );
};

export default ObjectsPriceContent;
